            {/*    Регистрация*/}
            {/*  </Button>*/}
            {/*</Grid>*/}
            {/*<Grid item>*/}
            {/*  <Button variant="outlined" color="primary" component={Link} to="/login">*/}
            {/*    Вход*/}
            {/*  </Button>*/}
            {/*</Grid>*/}
          </Grid>
        </Box>
      </main>
      {/*<Footer />*/}
    </>
  );
};

export default HomePage;
